// What non-users see
// - View all programs
// - View all courses
// - Button to go to Signup
// - Button/link to Login (can be modal or separate page)

function Home() {
  return ( 
    <div className="bg-[#3772FF] mx-auto px-4 py-40">
      <div>
        <h1 className="text-center text-3xl py-10 text-slate-900">Build Your Future In <br></br>Software Development</h1>
      </div>
        
    </div>
   
  );
}

export default Home;
